INSERT INTO `operation` (`ID`, `Name`, `NameAR`, `Code`, `systemChar`, `Anesthetic`, `Description`, `DescriptionAR`, `Los`) VALUES
(1, 'Tympanostomy ', 'فتحة طموح الطبل', 'A9433G', 'A', 'G', '(requiring insertion of ventilating tube)', ' (تتطلب إدخال أنبوب التهوية)', 1),
(2, 'Tympanoplasty with antrotomy or mastoidectomy ', 'جراحة إصلاح طموح الطبل مع توسيع الجيوب الأنفية أو استئصال العظم الدهني', 'A9635G', 'A', 'G', '(including canalplasty, atticotomy, middle ear surgery, and/or tympanic membrane repair): with or without ossicular chain reconstruction, any method', ' (بما في ذلك جراحة تشكيل القنوات، وفتح الهامش، وجراحة الأذن الوسطى، و/أو إصلاح غشاء الطبل): مع أو بدون إعادة بناء سلسلة العظام، بأي طريقة', 1),
(3, 'Insertion of permanent pacemaker any method\r\n', 'إدخال جهاز تنظيم دقات القلب الدائم بأي طريقة', 'C3245G', 'C', 'G', NULL, '', 2),
(4, 'Implantation of automatic implantable cardioverter-defibrillator pads with or without sensing electrodes', 'زرع وسادات جهاز التشديد القابل للزرع تلقائيًا مع أو بدون أقطاب الاستشعار', 'C3400G', 'C', 'G', NULL, '', 1),
(5, 'Transcatheter placement of an intravascular stent, (non coronary vessel), percutaneous or open: initial vessel', 'وضع قسطرة التداخل للشريان الوريدي، (شريان غير تاجي)، تنظيري أو مفتوح: الوعاء الأولي', 'C7205G', 'C', 'L', NULL, '', 3),
(6, 'Tonsillectomy with or without adenoidectomy', 'استئصال اللوزتين مع أو بدون استئصال اللوزة الليفية', 'D2820G', 'D', 'G', NULL, '', 1),
(7, 'Thyroidectomy, total or complete', 'استئصال الغدة الدرقية، كلياً أو جزئياً', 'E0240G', 'E', 'G', NULL, '', 2),
(8, 'Laparoscopy, surgical: with removal of adnexal structures', 'التنظير البطني (الجراحي): مع إزالة الهياكل الملحقة ', 'F6307G1', 'F', 'G', ' (partial or total oophorectomy and/or salpingectomy)', '(استئصال جزئي أو كلي للمبيض و/أو القناة اللفافية)', 3),
(9, 'One stage distal hypospadias repair (with or without chordee or circumcision): with simple meatal advancement', 'إصلاح شذوذ القضيب (الهيبوسباديا) في مرحلة واحدة (مع أو بدون انحناء أو ختان): مع التقدم الميتي البسيط', 'G4322G', 'G', 'G', '(eg, Magpi, V-flap)', '(مثل Magpi، وشريحة V)', 1),
(10, 'Excision of pilonidal cyst or sinus', 'استئصال الكيس أو المجرى العجزي', 'I1770G', 'I', 'G', NULL, '', 2),
(11, 'Excision of pilonidal cyst or sinus', 'استئصال الكيس أو المجرى العجزي', 'I1770G', 'I', 'G', NULL, '', 3),
(12, 'Removal of implant: deep', 'إزالة الزرعة: العميقة', 'M0680G', 'M', 'G', ' (eg, buried wire, pin, screw, metal band ,rod, nail or plate)', ' (مثل السلك المدفون، والدبوس، والمسمار، والشريط المعدني، والقضيب، والمسمار، أو الصفيحة)', 1),
(13, 'Craniectomy or craniotomy for evacuation of hematoma or drainage of intracranial absess', 'جراحة فتح الجمجمة أو عملية فتح الجمجمة لتفريغ الجلطة الدماغية أو تصريف الخراج الدماغي الداخلي', 'N1312G', 'N', 'G', NULL, '', 2),
(14, 'Fistulization of sclera for glaucoma: trabeculectomy ab externo', ' تحفير الغشاء البياضي لعلاج الجلوكوما: استئصال الشبكية البيضاء من الخارج', 'O6170G', 'O', 'G', NULL, '', 1),
(15, 'Tracheostomy', 'تراخيم القصبة الهوائية', 'R1600G', 'R', 'G', '', '', 2),
(16, 'Nephrostomy, nephrotomy with drainage', 'استئصال الكلية، نقل الكلية مع التصريف', 'U0040G', 'U', 'G', NULL, '', 3),
(17, 'Percutaneous transluminal angioplasty (other than coronary): single vessel with or without stent\r\n', 'توسيع الأوعية الدموية بالقثطرة النافذة (باستثناء الشرايين التاجية): الأوعية الفردية مع أو بدون قسطرة', 'X2982L1\r\n', 'X', 'L', NULL, '', 1);
